(120,1,"2019-07-21 18:35:01","2019-07-21 16:35:01","<!-- wp:paragraph -->\n<p>Admiral T annonce deux albums pour la rentrée 2019/2020. Avec deux clips \"<em>Boss Lady</em>\" feat <strong>Krys</strong> et \"<em>Baimbridge</em> Cho\" feat <strong>Were Vana</strong>. Les albums seront disponible qu\'en version digitale.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Caribbean Monster</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":121} -->\n<figure class=\"wp-block-image\"><img src=\"http://pepseeactus.local/wp-content/uploads/2019/07/67112364_10156714299347087_6249821407371329536_n.jpg\" alt=\"\" class=\"wp-image-121\"/><figcaption>Caribbean Monster</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Un album pure Dancehall avec en 1er single \"<em>Boss Lady</em>\" avec <strong>Krys</strong>, un featuring que tous les amateurs de Dancehall attendait avec impatience.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=BZyQnxRX7xE\\u0026feature=youtu.be\\u0026fbclid=IwAR1w-9nT6v3aUr_IKOQ099Zj08G4NhEie5Bew-sJ7sRGIw6HQ1zRkxjeSTA\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=BZyQnxRX7xE&amp;feature=youtu.be&amp;fbclid=IwAR1w-9nT6v3aUr_IKOQ099Zj08G4NhEie5Bew-sJ7sRGIw6HQ1zRkxjeSTA\n</div><figcaption>Admiral T x Krys - Boss Lady</figcaption></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:heading -->\n<h2>Mozaïka</h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"id\":122} -->\n<figure class=\"wp-block-image\"><img src=\"http://pepseeactus.local/wp-content/uploads/2019/07/67320275_10156714299277087_4653882298289094656_n.jpg\" alt=\"\" class=\"wp-image-122\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>Un album plutôt traditionnel tourné vers la culture du Ka. Son premier single \"<em>Baimbridge cho</em>\" avec <strong>Were Vana</strong> reprend le grand classique du maître Ka Guadeloupéen <strong>Guy Conquet</strong>&nbsp;</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=rKgvYzardtc\\u0026feature=youtu.be\\u0026fbclid=IwAR2775csKwp02hnUbIrMKGm19qLLDiOI9lr6VYPA8Q5t1RNkZgTpp7PpCpk\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=rKgvYzardtc&amp;feature=youtu.be&amp;fbclid=IwAR2775csKwp02hnUbIrMKGm19qLLDiOI9lr6VYPA8Q5t1RNkZgTpp7PpCpk\n</div><figcaption>Admiral T x Were Vana - Baimbridge Cho</figcaption></figure>\n<!-- /wp:core-embed/youtube -->","Admiral T annonce deux albums pour Septembre","","publish","open","open","","admiral-t-annonce-deux-albums-pour-septembre","","","2019-07-27 14:18:16","2019-07-27 12:18:16","",0,"http://pepseeactus.local/?p=120",0,"post","",0),
