(154,0,"2019-07-27 14:37:09","2019-07-27 12:37:09","<!-- wp:paragraph -->\n<p><strong>JmaX</strong> est né dans les Yvelines d\'une mère martiniquaise et d\'un père guadeloupéen. Ses parents reviennent aux Antilles en Martinique après sa naissance. Neveu de <strong>Kolo Barst</strong> mais surtout satisfait de ses origines, il découvre l\'univers du Reggae-Dancehall grâce à son grand frère <strong>DJ Pepsee</strong>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Mais c\'est à partir de 16 ans qu\'il se met à écrire ses premiers lyrics et fait des freestyles tous les week-end avec ses amis <strong>SlaX</strong> et <strong>Rochman</strong> d\'où ils fondent le groupe <em>Liberty Crew</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>C\'est en 2011 qu\'il se fait connaître avec son single \"<em>Djooky Dem</em>\" sur le EDF Riddim de <strong>DJ V-Trine</strong> ainsi que le single <em>Beau Parleur</em> sur le SME Riddim de <strong>Donshorty</strong>. En juin 2012, il sort sa première mixtape <em>Xplosion</em> qui cartonne en Martinique avec des sons tels que \"<em>Djooky Dem</em>\", \"<em>I Salé</em>\" et \"<em>Beau parleur</em>\". Par la suite, il fera la couverture du premier numéro du magazine Raggadaggazine. En 2013, il revient avec le single \"<em>Pren\'y Cool</em>\". En 2014, il sort son célèbre titre \"<em>Fanatique Girl</em>\" produit par <strong>Radix Corporation</strong> et dont le clip est réalisé par <strong>G-Islands</strong>. Son single \"<em>Fanatique Girl</em>\" devient son premier gros succès que le label Chabine Prod a décidé de faire un remix zouk, le \"<em>Fanatique Zouk Remix</em>\" édité sur la compilation <em>Les Tubes du Zouk 2014</em>. Aujourd\'hui, ce titre a dépassé les 1,1 million de vues sur YouTube. Ensuite, il fait un feat avec <strong>MrSM</strong> et <strong>JT</strong>, deux chanteurs du label <strong>TruchaGang</strong>, sur le single \"<em>6H30</em>\". On le découvre aussi en freestyle avec <strong>MrSM</strong> dans les studios de <strong>Rise Up Sound</strong>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 2015, il sort les sons \"<em>Pretty Gyal</em>\", \"<em>Es Nou Pa Té Two Jenn</em>\", \"<em>Ladjé Kow</em>\", \"<em>An Pa Tou Sèl</em>\" et \"<em>Je t\'assure</em>\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 2016, il sort sa seconde mixtape, <em>Reloaded</em><sup><a href=\"https://fr.wikipedia.org/wiki/JmaX#cite_note-3\">3</a></sup>, dans laquelle on trouve le tube \"<em>Laisse-moi t\'aimer</em>\" en featuring avec <strong>Stacy</strong>. Ensuite, il sort le gros tube \"<em>Kay La</em>\" puis un son doux, \"<em>Différents Styles</em>\". En 2017, il sort les titres \"<em>Milli</em>\", \"<em>Thug épi Gangstè</em>\", \"<em>Atirans</em>\", \"<em>Big Ben</em>\" et \"<em>Maman</em>\".</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 2018, il sort le clip de son single \"<em>Dépi sé Mizik</em>\". Il est invité par la chanteuse de Zouk <strong>Nesly</strong> sur son tube \"<em>Baby Doll</em>\". Après, il sort son album <em>Pull Di Trigger</em> dans lequel on trouve des sons comme \"<em>Wine up</em>\", \"<em>Passé en lè</em>\", \"<em>Fi dem</em>\", \"<em>Hustle</em>\" et j\'en passe.</p>\n<!-- /wp:paragraph -->","JmaX","Le deejay au grand coeur","publish","closed","closed","","jmax","","","2019-07-27 14:37:56","2019-07-27 12:37:56","",0,"http://pepseeactus.local/?post_type=artist&#038;p=154",0,"artist","",0),
